import React, { Component } from "react";
import { Link } from "react-router-dom";



export class Products extends Component {
    constructor() {
      super();
      this.state = {
        Products: [
          {
            SKU:1,
            name:'disco',
          },
          {
            SKU:1,
            name:'disco',
          },
          {
            SKU:1,
            name:'disco',
          },
          {
            SKU:1,
            name:'disco',
          },
          {
            SKU:1,
            name:'disco',
          },
        ]
      };
    }
   

  
    render() {
      return (
        <div className="App">
          
            {this.state.Products.map((product)=>{
              <div>
                  <h1>{product.name}</h1>
                  <h1>{product.SKU}</h1>
              </div>
            
            })}
         

          
         
        </div>
      );
    }
  }
